運転席や助手席の下部に設置可能なコンパクトタイプのパワード・サブウーファー「SWE-1500」。<br />
シート下にエアコン用ダクトや凹凸などがあり、不安定な取付けしかできない車種も多く存在します。<br />
新開発の車種専用　SWE-1500用バッフルボードを使えば、車種専用設計なので、柔らかい底面でも最適な場所に、パワード・サブウーファー　SWE-1500をしっかり固定できます。<br />
また、15mm厚のMDF製バッフルボードなので、重低域の音質にも大幅に貢献します。<br />
重低域が伸びる結果、再生帯域が拡大して、音圧も大幅に向上致します。<br /><br />
